import { useState } from 'react';
import { BrowserRouter as Router, Route }from 'react-router-dom';

function Leituradp () {
  return (
    <Router>
      <div>
        <Route path='/Exercicios/Leitura-de-partitura' exact component={Leituradp}>
          <div className='num'>
             <button> 1 </button>
            
          </div>
        </Route>
      </div>
    </Router>
  );
}

export default Leituradp;
